
for i = 0, datos.maxarrow do
	local ammo = util.table.deepcopy(data.raw["ammo"]["piercing-bullet-magazine"])
	ammo.name = "cursed-arrow-" .. i
	if i == 0 then
		ammo.name = "cursed-arrow"
	end
	ammo.icon = "__Cursed-Exp__/graphics/icons/arrow/cursed-arrow.jpg"
	ammo.ammo_type.category = "arrow"
	ammo.ammo_type.action.action_delivery.source_effects = nil
	ammo.ammo_type.action.action_delivery.target_effects[1].entity_name = "sunken_spike"
	ammo.ammo_type.action.action_delivery.target_effects[2].damage.amount = math.floor(((i ^ 2 * 0.0015+ i * 0.35 ) / 2 + 4.8) * 100) / 100
	if i == 0 then
		ammo.ammo_type.action.action_delivery.target_effects[2].damage.amount = 0
	end
	ammo.subgroup = "cursed-arrows"
	if i == 0 then
		ammo.subgroup = "cursed-item"
	end
	ammo.stack_size = 500
	ammo.magazine_size = 30
	data.raw[ammo.type][ammo.name] = ammo
end

